import React, { Component } from 'react';
import './view/css/bootstrap.css';
import './view/css/main.css';
import './view/css/font-awesome.css';
class App extends Component {
  render() {
    return (
      <div>
        <input type="text" class="form-control form-rounded" placeholder="Text input"/>
        <br/>
        <button type="button" class="btn btn-info form-rounded">Info</button>
      </div>
    );
  }
}

export default App;
